import React from "react";
import styled from "styled-components";

const Wrapper=styled.div`
    width:56%;
    padding-bottom:10%;
    height:0;
    position:relative;

    &>div{
        position: absolute;
        left:0;
        right:0;
        bottom:0;
        top:0;
        background-color:#eee;

        display:flex;
        justify-content:center;
        align-items:center;
    }
`;



const MovieItem=(props)=>{
    return(
        <Wrapper>MovieItem</Wrapper>
    )
}

export default MovieItem;
